# 基本格式：
#   - 名稱: "<名稱>"
#     註記: <註記>
#     筆劃組:
#       筆劃:
#         - <筆劃描述>
#         - <筆劃描述>
#         - <筆劃描述>
#         - <筆劃描述>
#
# {筆劃描述} 的格式：
#       - {方式: 定義, 類型: {筆劃類型}, 起始點: <起始點>, 參數: <參數>}
#       - {方式: 錨點, 名稱: "<名稱>", 引用名稱: "<引用名稱>"[, 定位: <定位>]}
#       - {方式: 引用, 引用名稱: "<引用名稱>", 順序: <順序>[, 定位: <定位>]}
#
# 類型，是實際定義筆劃。
# 方式，是使用之前定義部件的某些筆劃。
# 描點，則是把所指涉部件放進來當樣本。
# 再透過「引用」來決定要使用哪些筆劃。
#
# 範例：
#   - 名稱: "#血"
#     筆劃組:
#       筆劃:
#        - 方式: 錨點
#           名稱: "&皿"
#           引用名稱: "#皿"
#           定位: [15, 61, 247, 220]
#        - {方式: 定義, 類型: 撇, 起始點: [123, 21], 參數: [25, 46]}
#        - {方式: 引用, 引用名稱: "&皿", 順序: [0, 1, 2, 3, 4]}
#
